#if !os(Linux)

import XCTest
#if os(OSX)
    import AppKit
#elseif os(iOS) || os(tvOS) || os(watchOS)
    import UIKit
#endif
@testable import Conduit

class MockResource {
    /// Data resources
    static let badSSLCertificate = MockResource.badCertificateBase64
    static let validSSLCertificate = MockResource.validCertificateBase64
    static let sampleVideo = MockResource.videoBase64

    /// Image resources
    static let evilSpaceshipImage = MockResource.evilSpaceshipBase64.image
    static let cellTowersImage = MockResource.cellTowersBase64.image
}

// MARK: Base64 encoded data resources

extension MockResource {

    // swiftlint:disable line_length

    fileprivate static let badCertificateBase64: Data = ""

    fileprivate static let validCertificateBase64: Data = ""

    fileprivate static let cellTowersBase64: Data = ""

    fileprivate static let evilSpaceshipBase64: Data = ""

    fileprivate static let videoBase64: Data = ""

    // swiftlint:enable line_length

}

// MARK: Data extensions for string literals and image conversion

extension Data: ExpressibleByStringLiteral {
    public init(stringLiteral value: StaticString) {
        guard let data = Data(base64Encoded: "\(value)") else {
            XCTFail()
            fatalError("Invalid data string")
        }
        self = data
    }

    public init(unicodeScalarLiteral value: StaticString) {
        self.init(stringLiteral: value)
    }

    public init(extendedGraphemeClusterLiteral value: StaticString) {
        self.init(stringLiteral: value)
    }

    var image: Image {
        guard let image = Image(data: self) else {
            XCTFail()
            fatalError("Invalid image")
        }
        return image
    }
}

#endif
